import axios from "axios";
import { useState } from "react";
import DisplayErrors from "../../utils/DisplayErrors";
import { projectCreationDto } from "./projects.mode";
import React from "react";
import ProjectForm from "./ProjectForm";
import * as projectEndpoints from "../../endpoints/ProjectEndpoints";
    
export default function CreateProject() {

    const [errors, setErrors] = useState<string[]>([]);

    async function create(project: projectCreationDto) {
        try {
            projectEndpoints.createProject(project)
        }
        catch (error) {

            if (axios.isAxiosError(error)) {
                setErrors(error.response?.data as string[]);
            }
        }

    }

    return (
        <>
            <h3>Create Project</h3>
            <DisplayErrors errors={errors} />
            
            <ProjectForm model={{ name: 'Project 11', projectId: 11, description: 'Project 11 descript', deadline: '02.05.2024'}}

                onSubmit={async value => {

                    await create(value);
                }}
            />
        </>
    )
}
